// JavaScript source code
import React from 'react';
import { Menu } from 'semantic-ui-react';

export default ()=>{
    return (
        <Menu style={{marginTop:'10px'}}>
            <Menu.Item>首页</Menu.Item>
            <Menu.Item position= 'right'>
                <Menu.Item>众筹</Menu.Item>
                <Menu.Item>+</Menu.Item>
            </Menu.Item>
        </Menu>
    );
}
